import React from 'react';

import classes from './User.module.scss';

import User from '../../components/User';

const authIndexPage = () => (
    <div className={classes.Div}>
        <h1>The auth index page</h1>
        <User name="Niranjan" age="28" />
    </div>
);

export default authIndexPage
